  true,\n\t\"url\": null,\n\t\"notes\": \"The SSMI/S LPVEX dataset contains brightness
  temperature data processed from the NOAA CLASS QC temperature data records for the
  Light Precipitation Validation Experiment, part of the Global Precipitation Measurement
  project.  Only data with swaths within the area of interest are included.  The temporal
  range of the data includes the LPVEx campaign period (Sep/Oct 2010) and extends
  through the end of March 2011.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
